import React from 'react';
import {Link} from 'react-router-dom';
import IsAuthenticated from 'Auth.js';

const logged = () => {
  if (IsAuthenticated){
    return (
      <span>
        Logado!
      </span>
    )
  } else {
    <span>
      Deslogado!
    </span>
  }
}

const Navbar = () => {
  return(
    <>
      <ul>
        <li>
          <Link to='/'>
            Welcome
          </Link>
          <Link to='Login'>
            Login
          </Link>
          <Link to='signup'>
            SignUp
          </Link>
          <Link to='items'>
            Items
          </Link>
          <Link to='me'>
            Me
          </Link>
          <Link to='cart'>
            Cart
          </Link>
        </li>
      </ul>
    </>
  )
}

export default Navbar;
